(function() {
    'use strict';

    function playNextVideo() {
        const listItems = document.querySelectorAll('.listGroup .listItem');
        let found = false;

        for (let i = 0; i < listItems.length; i++) {
            const item = listItems[i];
            const title = item.querySelector('.text'); // 查找标题元素
            if (title) {
                title.click(); // 模拟点击标题
                found = true;
                break;
            }
        }

        if (!found) {
            console.error('No more videos to play.');
        }
    }

    // 监听进度条的变化
    function checkProgress() {
        const playedElement = document.querySelector('.bplayer-progress-played');

        if (playedElement) {
            const playedWidth = parseFloat(playedElement.style.width);

            // 如果进度条的宽度达到100%，则播放下一个视频
            if (playedWidth >= 100) { // 视频播放完成的阈值
                playNextVideo();
            }
        }
    }

    // 创建并显示模态框
    function showImageModal(base64Image, altText, description) {
        // 创建模态框的 HTML 结构
        const modal = document.createElement('div');
        modal.className = 'modal';
        modal.innerHTML = `
            <div class="modal-content">
                <span class="close">&times;</span>
                <img src="${base64Image}" alt="${altText}" class="modal-image">
                <p class="modal-description">${description}</p>
                <p class="timer">20 秒后自动关闭</p>
            </div>
        `;

        // 添加关闭按钮的事件监听器
        const closeBtn = modal.querySelector('.close');
        closeBtn.addEventListener('click', function() {
            modal.style.display = 'none';
        });


        document.body.appendChild(modal);


        modal.style.display = 'block';


        let timeLeft = 60;
        const timerDisplay = modal.querySelector('.timer');
        const intervalId = setInterval(() => {
            timeLeft--;
            timerDisplay.textContent = `${timeLeft} 秒后自动关闭`;
            if (timeLeft <= 0) {
                clearInterval(intervalId);
                modal.style.display = 'none';
            }
        }, 1000);
    }

    
    window.onload = function() {
        
        const base64Image = 'data:image/jpeg;base64,'; // 请将这里的Base64编码替换成您的实际Base64编码
        showImageModal(base64Image, '示例图片', '❤如果您觉得它对您的工作或学习有所帮助，或是让您节省了一些宝贵的时间，那将是我最大的荣幸❤。如果我的努力给您带来了便利，请考虑通过赞赏码给予我一点点支持。您的每一份赞赏都是对我最大的鼓励，也是我继续改进和完善的动力☺（也可以通过赞赏码来反馈问题）。当然，如果您暂时不方便，也请不要有任何负担，您的使用和支持本身就是对我莫大的鼓励！');

        setInterval(function() {
            try {
                checkProgress();
            } catch (e) {
                console.error('Error checking progress:', e);
            }
        }, 5000); // 每5秒检查一次进度
    };

    // 添加模态框的样式
    const style = document.createElement('style');
    style.type = 'text/css';
    style.innerHTML = `
        .modal {
            display: none; /* 默认隐藏 */
            position: fixed; /* 固定定位 */
            z-index: 1000; /* 放在最顶层 */
            left: 0;
            top: 0;
            width: 100%; /* 宽度100% */
            height: 100%; /* 高度100% */
            overflow: auto; /* 允许滚动 */
            background-color: rgba(0,0,0,0.4); /* 半透明背景 */
        }

        .modal-content {
            background-color: #fefefe;
            margin: 15% auto; /* 距离顶部15% */
            padding: 20px;
            border: 1px solid #888;
            width: 80%; /* 宽度80% */
            max-width: 600px; /* 最大宽度 */
            text-align: center;
        }

        .close {
            color: #aaa;
            float: right;
            font-size: 28px;
            font-weight: bold;
        }

        .close:hover,
        .close:focus {
            color: black;
            text-decoration: none;
            cursor: pointer;
        }

        .modal-image {
            max-width: 50%; /* 图片宽度减小 */
            height: auto;
        }

        .modal-description {
            margin-top: 20px;
            font-size: 20px;
            color: #333;
        }

        .timer {
            margin-top: 10px;
            font-size: 16px;
            color: #ff0000;
        }
    `;
    document.head.appendChild(style);
})();